import React, { useState } from "react";
import { useTheme } from "../context/ThemeContext";
import { backendApi } from "../services/backendApi";

export default function AICoaching() {
  const { theme } = useTheme();
  const [userMessage, setUserMessage] = useState("");
  const [isLoading, setIsLoading] = useState(false);
  const [response, setResponse] = useState("");
  const [error, setError] = useState("");

  const handleSubmit = async (e) => {
    e.preventDefault();
    if (!userMessage.trim()) return;

    setIsLoading(true);
    setError("");
    setResponse("");

    try {
      const result = await backendApi.generateCoachingResponse(
        userMessage,
        null, // workoutData - you can add this later
        "Fitness coaching request" // context
      );

      setResponse(result.response);
    } catch (err) {
      setError(err.message);
    } finally {
      setIsLoading(false);
    }
  };

  const handleQuickQuestion = (question) => {
    setUserMessage(question);
  };

  return (
    <div style={{
      padding: "2rem",
      background: theme.background,
      minHeight: "100vh",
      color: theme.text,
      transition: "background-color 0.3s ease, color 0.3s ease"
    }}>
      <div style={{
        maxWidth: "800px",
        margin: "0 auto"
      }}>
        {/* Header */}
        <div style={{
          textAlign: "center",
          marginBottom: "3rem"
        }}>
          <h1 style={{
            fontSize: "2.5rem",
            color: theme.accent,
            marginBottom: "1rem",
            transition: "color 0.3s ease"
          }}>
            ðŸ¤– AI Fitness Coach
          </h1>
          <p style={{
            fontSize: "1.1rem",
            color: theme.textSecondary,
            lineHeight: "1.6",
            transition: "color 0.3s ease"
          }}>
            Get personalized fitness advice and coaching from our AI assistant
          </p>
        </div>

        {/* Quick Questions */}
        <div style={{
          marginBottom: "2rem"
        }}>
          <h3 style={{
            fontSize: "1.3rem",
            color: theme.accent,
            marginBottom: "1rem",
            transition: "color 0.3s ease"
          }}>
            Quick Questions
          </h3>
          <div style={{
            display: "flex",
            flexWrap: "wrap",
            gap: "0.8rem"
          }}>
            {[
              "How can I improve my bench press?",
              "What's the best workout for beginners?",
              "How often should I train each muscle group?",
              "What should I eat before a workout?",
              "How do I fix my squat form?",
              "What's a good cardio routine?"
            ].map((question, index) => (
              <button
                key={index}
                onClick={() => handleQuickQuestion(question)}
                style={{
                  background: theme.accentSecondary,
                  color: theme.accent,
                  border: "none",
                  borderRadius: "8px",
                  padding: "0.6rem 1rem",
                  cursor: "pointer",
                  fontSize: "0.9rem",
                  transition: "background 0.2s ease",
                  whiteSpace: "nowrap"
                }}
                onMouseOver={e => e.currentTarget.style.background = theme.accentHover}
                onMouseOut={e => e.currentTarget.style.background = theme.accentSecondary}
              >
                {question}
              </button>
            ))}
          </div>
        </div>

        {/* Input Form */}
        <div style={{
          background: theme.cardBackground,
          borderRadius: "16px",
          padding: "2rem",
          marginBottom: "2rem",
          border: `1px solid ${theme.cardBorder}`,
          boxShadow: theme.shadow,
          transition: "background-color 0.3s ease, border-color 0.3s ease"
        }}>
          <form onSubmit={handleSubmit}>
            <div style={{ marginBottom: "1.5rem" }}>
              <label style={{
                display: "block",
                marginBottom: "0.8rem",
                color: theme.textSecondary,
                fontSize: "1rem",
                fontWeight: "600",
                transition: "color 0.3s ease"
              }}>
                Ask your fitness question:
              </label>
              <textarea
                value={userMessage}
                onChange={(e) => setUserMessage(e.target.value)}
                placeholder="e.g., I've been doing bench press for 3 months but my progress has stalled. What should I do?"
                style={{
                  width: "100%",
                  minHeight: "120px",
                  padding: "1rem",
                  borderRadius: "12px",
                  border: `1px solid ${theme.inputBorder}`,
                  background: theme.inputBackground,
                  color: theme.text,
                  fontSize: "1rem",
                  resize: "vertical",
                  fontFamily: "inherit",
                  transition: "background-color 0.3s ease, color 0.3s ease, border-color 0.3s ease"
                }}
              />
            </div>
            <button
              type="submit"
              disabled={isLoading || !userMessage.trim()}
              style={{
                background: isLoading || !userMessage.trim() ? theme.surfaceTertiary : theme.accent,
                color: isLoading || !userMessage.trim() ? theme.textMuted : theme.background,
                border: "none",
                borderRadius: "12px",
                padding: "1rem 2rem",
                cursor: isLoading || !userMessage.trim() ? "not-allowed" : "pointer",
                fontSize: "1rem",
                fontWeight: "600",
                transition: "all 0.3s ease",
                width: "100%"
              }}
              onMouseOver={e => {
                if (!isLoading && userMessage.trim()) {
                  e.currentTarget.style.background = theme.accentHover;
                }
              }}
              onMouseOut={e => {
                if (!isLoading && userMessage.trim()) {
                  e.currentTarget.style.background = theme.accent;
                }
              }}
            >
              {isLoading ? "ðŸ¤– Getting AI advice..." : "ðŸ’ª Get AI Coaching"}
            </button>
          </form>
        </div>

        {/* Error Display */}
        {error && (
          <div style={{
            background: "rgba(239, 68, 68, 0.1)",
            border: "1px solid rgba(239, 68, 68, 0.3)",
            borderRadius: "12px",
            padding: "1rem",
            marginBottom: "2rem",
            color: "#ef4444"
          }}>
            <strong>Error:</strong> {error}
          </div>
        )}

        {/* Response Display */}
        {response && (
          <div style={{
            background: theme.cardBackground,
            borderRadius: "16px",
            padding: "2rem",
            border: `1px solid ${theme.cardBorder}`,
            boxShadow: theme.shadow,
            transition: "background-color 0.3s ease, border-color 0.3s ease"
          }}>
            <div style={{
              display: "flex",
              alignItems: "center",
              marginBottom: "1.5rem",
              gap: "0.8rem"
            }}>
              <div style={{
                width: "40px",
                height: "40px",
                borderRadius: "50%",
                background: `linear-gradient(135deg, ${theme.accent}, ${theme.accentHover})`,
                display: "flex",
                alignItems: "center",
                justifyContent: "center",
                fontSize: "1.2rem"
              }}>
                ðŸ¤–
              </div>
              <h3 style={{
                margin: 0,
                color: theme.accent,
                fontSize: "1.3rem",
                fontWeight: "600",
                transition: "color 0.3s ease"
              }}>
                AI Coach Response
              </h3>
            </div>
            <div style={{
              color: theme.text,
              lineHeight: "1.7",
              fontSize: "1rem",
              whiteSpace: "pre-wrap",
              transition: "color 0.3s ease"
            }}>
              {response}
            </div>
          </div>
        )}
      </div>
    </div>
  );
}
